import { AttachMoney, HomeOutlined, ListAlt, PaidOutlined, SupervisorAccountOutlined } from '@material-ui/icons';
import React from 'react';

export const SideMenuData = [
    {
        title: "Dashboard",
        icon: <HomeOutlined />,
        link: "/dashboard"
    },
    {
        title: "Taxas",
        icon: <AttachMoney />,
        link: "/taxas"
    },
    {
        title: "Paiments",
        icon: <PaidOutlined />,
        link: "/paiements"
    },
    {
        title: "Associações",
        icon: <ListAlt />,
        link: "/associacoes"
    },
    {
        title: "Administradores",
        icon: <SupervisorAccountOutlined />,
        link: "/administradores"
    },
    {
        title: "Profile",
        icon: <SupervisorAccountOutlined />,
        link: "/profile"
    }
    
];

export const SideMenuDataUser = [
    {
        title: "Dashboard",
        icon: <HomeOutlined />,
        link: "/dashboard"
    },
    {
        title: "Profile",
        icon: <SupervisorAccountOutlined />,
        link: "/profile"
    },
    {
        title: "Administradores",
        icon: <SupervisorAccountOutlined />,
        link: "/administradores"
    },
];

export const SideMenuDataModerator = [
    {
        title: "Dashboard",
        icon: <HomeOutlined />,
        link: "/dashboard"
    },
    {
        title: "Paiements",
        icon: <PaidOutlined />,
        link: "/paiements"
    }
]
